import React from 'react'

const ExternalServices = () => {
    return (
        <div style={{display:"inline",position:"relative"}}>
        {ServicesList.map(({name, iconDir}) => (
        <div className={"external-account"}><a href={"https://www.google.com"}>{name}<img src={iconDir}/></a></div>
        ))}
        </div>
    )
}
const ServicesList = [
    {
    key:1,
    name: "google",
    adress: "https://www.google.com",
    iconDir: "../../src/images/icons/external1Google.png"
    },
    {
    key:2,
    name: "facebook",
    adress: "https://www.facebook.com",
    iconDir: "../images/icons/external1Google.png"
    },
]

export default ExternalServices
